import React, {Component} from 'react';
import './home.css';
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fab } from '@fortawesome/free-brands-svg-icons'
import { library } from '@fortawesome/fontawesome-svg-core';
library.add(fab);

function ItemsHeader() {
  const icons = {
    items : [
      { item: 'linkedin', url: 'https://fr.linkedin.com/in/athmane-hafsi-ab33a7153' },
      { item: 'github-square', url: 'https://github.com/athmaneHafsi'}
    ],
  }
  return (
      <div className="itemsHeader">
      {icons.items.map((item, i)=>{
        return (<a href={item.url} key={i} className="url"><FontAwesomeIcon icon={['fab', item.item]} /></a>)
      })}
      </div>

  );
}


class HomeComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
          height: props.height,
          scrollTo: props.height
        };
    }

    handle(e) {
      window.scrollTo(0,700);
    }

    render() {
      const buttons = {
        buttons: [
          { item: 'ABOUT' },
          { item: 'PORTFOLIO' }
        ],
      }
        return (
          <div className="header-wrapper" style={{"height": this.state.height}}>
            <div className="header">
              <MuiThemeProvider theme={theme}>
                {buttons.buttons.map((item, i)=>{
                return <Button onClick={(e) => this.handle(e)} className='button-header' key={i}>{item.item}</Button>
                })}
              </MuiThemeProvider>
            </div>
            <div className="homeClasse">
                <h3>Hi ! I'm Athmane Hafsi</h3>
                <h6>Developer Full-Stack</h6>
                <div className="itemsHeader">
                  <a href='https://fr.linkedin.com/in/athmane-hafsi-ab33a7153' className="url"><FontAwesomeIcon icon={['fab', 'linkedin']} /></a>
                  <a href='https://github.com/athmaneHafsi' className="url"><FontAwesomeIcon icon={['fab', 'github-square']} /></a>
              </div>
            </div>

          </div>
        );
    }
}

export default HomeComponent;
